&lt;p&gt;&lt;strong&gt;Radio address given by Ellen Margrethe LÃƒÂ¸j&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&lt;em&gt;Special Representative of the Secretary-General and Coordinator of United Nations Operations in Liberia&lt;/em&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;&lt;em&gt;Monrovia, Monday November 7, 2011 &lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;On 8&lt;sup&gt;th&lt;/sup&gt; of November the run-off elections takes place. &lt;/li&gt;
&lt;li&gt;To vote is an individual democratic right Ã¢â‚¬â€œ it is your personal right and it is your personal choice&lt;/li&gt;
&lt;li&gt;All Liberia who wish to exercise their right to vote, should be able to do so in peace and without intimidation &lt;/li&gt;
&lt;li&gt;Peaceful, credible, and transparent elections are important to ensure that the peace in Liberia is maintained.&lt;/li&gt;
&lt;/ul&gt;
&lt;ul&gt;
&lt;li&gt;For the past Eight (8) years UNMIL has been here to help ensure that peace is maintained in Liberia. We are here today and on November 8&lt;sup&gt;th&lt;/sup&gt; and the days to follow, to continue to protect Liberia as they exercise their individual democratic rights.Ã‚Â  &lt;/li&gt;
&lt;/ul&gt;
&lt;ul&gt;
&lt;li&gt;You will see UNMIL staff, police and military on the streets and in the air all around the country &lt;/li&gt;
&lt;li&gt;Ã¢â‚¬Â¦We are here to ensure everything is peaceful and Ã¢â‚¬Â¦We are here to deter anyone who intends to destroy the peace.&lt;/li&gt;
&lt;/ul&gt;
&lt;ul&gt;
&lt;li&gt;International observers from ECOWAS, from the AU, the Carter Center and others are here to monitor the whole election processÃ¢â‚¬Â¦but it is &lt;strong&gt;you&lt;/strong&gt;, the &lt;strong&gt;Liberia voters&lt;/strong&gt; who have to decide whether you will contribute to consolidating democracy and peace in Liberia.&lt;/li&gt;
&lt;/ul&gt;
&lt;ul&gt;
&lt;li&gt;But first and foremost, regardless of your political views, I appeal to all Liberia to say no to violence on Election Day.&lt;/li&gt;
&lt;li&gt;Ã‚Â Ã¢â‚¬Å“Liberia is all you haveÃ¢â‚¬Â Ã¢â‚¬â€œ help build it democratically, do not destroy it violently.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;I thank you.&lt;/p&gt;
&lt;p&gt;Ã‚Â &lt;/p&gt;
&lt;p&gt;(Listen to the radio broadcast via the attached mp3 link)&lt;/p&gt;

&lt;p&gt;From the Liberia New Dawn online newspaper, Nov 7th:&lt;/p&gt;
&lt;p&gt;The United States State Department has strongly condemned Cllr.  WinstonTubmanÃ¢â‚¬â„¢s Congress for Democratic Change or the CDC for  boycotting the November 8 presidential runoff election.&lt;/p&gt;
&lt;p&gt;A State Department statement issued under the signature of Victoria  Nuland, spokesperson on the Liberia elections, indicated that United  States government is deeply disappointed by the decision of the CDC to  boycott the runoff election.&lt;br /&gt;&lt;br /&gt; Ã¢â‚¬Å“The CDC's charge that the  first-round election was fraudulent is unsubstantiated. As evidenced by  international and domestic observers, Liberia's October 11 first-round  presidential and legislative elections were fair, free and transparent,Ã¢â‚¬Â  said Madam Nuland.&lt;br /&gt;&lt;br /&gt;According to her, Washington supports the  LiberiaÃ¢â‚¬â„¢s democratic process moving forward, Ã¢â‚¬Å“We are supportive of  moving forward with the November 8 election as called for by the  National Elections Commission,Ã¢â‚¬Â the United States official maintained.&lt;br /&gt;&lt;br /&gt;Ã¢â‚¬Å“Participation  in elections is a fundamental part of democracy. We commend all  Liberia for their peaceful participation in the elections, and  encourage all Liberia to exercise their political voice and vote on  November 8,Ã¢â‚¬Â Madam Nuland stressed.&lt;br /&gt;&lt;br /&gt;She said that the United  States government and its people commend the leadership of ECOWAS and  note the important contributions of UNMIL in promoting security during  the electoral period, as well as working with all sides to protect the  integrity of Liberia's democracy.&lt;br /&gt;&lt;br /&gt; Meanwhile, Madam Victoria  Nuland has reassured the Liberia populace that the international  community, including the United States, will again send observers to  monitor the election process.&lt;/p&gt;

&lt;p&gt;From AllAfrica.com website, an article originally published by the Liberia newspaper, the Analyst on Nov 7th:&lt;/p&gt;
&lt;p&gt;&lt;em&gt;Both the Constitution of Liberia and the Election Laws of Liberia  mandate a runoff candidate, who had filed complaints to NEC, to prepare  for participation even while, not after, NEC looked into the  complaints. Current trends indicate that CDC had flouted that mandate;  and, from all indications, it appears unprepared to participate in  tomorrowÃ¢â‚¬â„¢s runoff. CDC says it is not participating because NEC  defaulted; NEC says if it defaulted, that was because CDC did everything  to filibuster the proceedings even thought it did not have to conclude  everything before the runoff date. However, PresidentEllenJohnsonSirleaf has  different idea: CDC boycotts becauseWinstonTubman is afraid of defeat. The  Analyst, reports.Ã‚Â Ã‚Â Ã‚Â Ã‚Â Ã‚Â  &lt;/em&gt;&lt;/p&gt;
&lt;p&gt;Ã¢â‚¬Å“Do not succumb to fear and intimidation.Ã‚Â  Do not allow any  politician to hold our country hostage.Ã‚Â  Do not allow Mr.WinstonTubman to  falsely claim Ã¢â‚¬ËœboycottÃ¢â‚¬â„¢ when what he is doing is forfeiting the right to  the finals because he fears defeat!Ã¢â‚¬Â These words of encouragement to  the Liberia people were contained the statement President Ellen EllenJohnsonSirleaf delivered on November 5, 2011, before an array of  government officials, political and religious leaders, and civil society  representatives on November 5, 2011. The president organized the  occasion to mark the conclusion of the electoral process, which NEC  initiated in January this year.&lt;/p&gt;
&lt;p&gt;To read the rest of the article, please visit the online article: http://allafrica.com/stories/201111070417.html&lt;/p&gt;

&lt;p&gt;Ã‚Â &lt;/p&gt;
&lt;div id="_mcePaste" style="position: absolute; left: -10000px; top: 0px; width: 1px; height: 1px; overflow-x: hidden; overflow-y: hidden;"&gt;ubman, who set the country on edge with his call for voters to stay away from Tuesday's run-off presidential election, said he wants his supporters to stage a "peaceful protest" on Monday.&lt;/div&gt;
&lt;div id="_mcePaste" style="position: absolute; left: -10000px; top: 0px; width: 1px; height: 1px; overflow-x: hidden; overflow-y: hidden;"&gt;Ã‚Â &lt;/div&gt;
&lt;div id="_mcePaste" style="position: absolute; left: -10000px; top: 0px; width: 1px; height: 1px; overflow-x: hidden; overflow-y: hidden;"&gt;A vigil outside his Congress for Democratic Change headquarters on Saturday and Sunday drew only a handful of people, far from the tens of thousands which spilled into the streets ahead of the first round polls on October 11.&lt;/div&gt;
&lt;div id="_mcePaste" style="position: absolute; left: -10000px; top: 0px; width: 1px; height: 1px; overflow-x: hidden; overflow-y: hidden;"&gt;The boycott call raised tensions in the last days of an election campaign which fizzled out Sunday as the CDC was absent and a last tour through the capital by President EllenJohnsonSirleaf failed to draw the crowds.&lt;/div&gt;
&lt;div id="_mcePaste" style="position: absolute; left: -10000px; top: 0px; width: 1px; height: 1px; overflow-x: hidden; overflow-y: hidden;"&gt;Addressing the populous Red Light market district, the Nobel Peace Prize winner praised her country's eight years of peace after a brutal 14-year conflict which left some 250,000 dead ended in 2003.&lt;/div&gt;
&lt;div id="_mcePaste" style="position: absolute; left: -10000px; top: 0px; width: 1px; height: 1px; overflow-x: hidden; overflow-y: hidden;"&gt;"I know that nobody in this country, no matter what the talk or rhetoric, nobody really wants us to go back to war," she said.&lt;/div&gt;
&lt;p&gt;Source: All Africa.comÃ‚Â &lt;/p&gt;
&lt;p&gt;Tubman, who set the country on edge with his call for voters to stay away from Tuesday's run-off presidential election, said he wants his supporters to stage a "peaceful protest" on Monday.&lt;br /&gt;&lt;br /&gt;Ã‚Â A vigil outside his Congress for Democratic Change headquarters on Saturday and Sunday drew only a handful of people, far from the tens of thousands which spilled into the streets ahead of the first round polls on October 11.&lt;br /&gt;The boycott call raised tensions in the last days of an election campaign which fizzled out Sunday as the CDC was absent and a last tour through the capital by President EllenJohnsonSirleaf failed to draw the crowds.&lt;br /&gt;Addressing the populous Red Light market district, the Nobel Peace Prize winner praised her country's eight years of peace after a brutal 14-year conflict which left some 250,000 dead ended in 2003.&lt;br /&gt;"I know that nobody in this country, no matter what the talk or rhetoric, nobody really wants us to go back to war," she said.&lt;/p&gt;
&lt;p&gt;&lt;a href="http://allafrica.com/stories/201111070806.html"&gt;Read more&lt;/a&gt;&lt;/p&gt;
&lt;p&gt;Ã‚Â &lt;/p&gt;

&lt;p&gt;Source: AlJazeera&lt;/p&gt;
&lt;p style="text-align: justify;"&gt;At least one person has been killed in an exchange of gunfire between Liberia police and protesters as a mass opposition rally in Monrovia, the capital, turned violent on the eve of a presidential election runoff vote, according to reports from the scene.&lt;/p&gt;
&lt;p style="text-align: justify;"&gt;Opposition demonstratorsÃ‚Â took to the streetsÃ‚Â on MondayÃ‚Â after WinstonTubman, the opposition candidate hoping to unseat EllenJohnsonSirleaf, said he would boycott the runoff and called on his supporters to do likewise over fears of fraud favouring the incumbent president.&lt;/p&gt;
&lt;p style="text-align: justify;"&gt;A photographer for the Associated Press news agencyÃ‚Â saw the body of a man, his head bloodied, lying at the headquarters ofWinstonTubman's Congress for Democratic Change (CDC) party.&lt;/p&gt;
&lt;p&gt;&lt;a href="http://aljazeera.com/news/africa/2011/11/20111171433737475.html"&gt;Read more&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;span class="articleLocation"&gt;Reuters online news:&lt;/span&gt; Sporadic gunfire rocked the centre of "Monrovia on Monday after Liberia riot police fired tear gas to disperse several hundred supporters of presidential challenger WinstonTubman, and at least one person was killed, a Reuters witness said.&lt;/p&gt;
&lt;p&gt;A Reuters reporter saw a dead body atWinstonTubman's CDC party  headquarters and several people were injured, including two police officers. CDC party members said four other people had been killed but this could not be confirmed.&lt;/p&gt;
&lt;p&gt;Tension has risen in Monrovia ahead of an election run-off betweenWinstonTubman and President EllenJohnsonSirleaf withWinstonTubman  calling on his supporters to boycott the vote over alleged irregularities.&lt;/p&gt;
&lt;p&gt;Several hundredWinstonTubman supporters had faced off against riot police before the violence erupted when tear gas was used.&lt;/p&gt;
&lt;p&gt;Two United Nations helicopters flew overhead as police andWinstonTubman's rock-throwing supporters clashed in side streets. A U.N. vehicle was attacked."&lt;/p&gt;

&lt;p class="introduction" style="color: #333333; font-family: Arial, Helmet, Freesans, sans-serif; line-height: 18px; margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; font-size: 1.077em; text-rendering: auto; clear: left; font-weight: bold; padding: 0px;"&gt;Source: British Broadcasting Corporation&lt;/p&gt;
&lt;p class="introduction" style="color: #333333; font-family: Arial, Helmet, Freesans, sans-serif; line-height: 18px; margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; font-size: 1.077em; text-rendering: auto; clear: left; font-weight: bold; padding: 0px;"&gt;Shots have been fired during an opposition protest in Monrovia ahead of Liberia's presidential run-off.&lt;/p&gt;
&lt;p style="color: #333333; font-family: Arial, Helmet, Freesans, sans-serif; line-height: 18px; margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; font-size: 1.077em; text-rendering: auto; clear: left; padding: 0px;"&gt;Hundreds of opposition supporters are said to have exchanged fire with the police.Ã‚Â &lt;/p&gt;
&lt;p style="color: #333333; font-family: Arial, Helmet, Freesans, sans-serif; line-height: 18px; margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; font-size: 1.077em; text-rendering: auto; clear: left; padding: 0px;"&gt;Congress for Democratic Change (CDC) candidate WinstonTubman has pulled out of Tuesday's vote, alleging fraud.&lt;/p&gt;
&lt;p style="color: #333333; font-family: Arial, Helmet, Freesans, sans-serif; line-height: 18px; margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; font-size: 1.077em; text-rendering: auto; clear: left; padding: 0px;"&gt;Nobel Peace laureate EllenJohnsonSirleaf, Africa's first elected female head of state, won the first round but failed to pass the 50% threshold.&lt;/p&gt;
&lt;p style="color: #333333; font-family: Arial, Helmet, Freesans, sans-serif; line-height: 18px; margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; font-size: 1.077em; text-rendering: auto; clear: left; padding: 0px;"&gt;&lt;a href="http://www.bbc.co.uk/news/world-africa-15624471"&gt;Read more&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Source: Kings FM 88.5&lt;/p&gt;
&lt;p&gt;Ã‚Â &lt;/p&gt;
&lt;p&gt;Reports gathered from the Kings Fm radio station says Ã‚Â there is a riot where police are beating cdc partisans and shooting tears gas at the headquarters of the Congress for Democratic Change (CDC) in Ã‚Â Congo Town.&lt;/p&gt;

&lt;p&gt;Aljazeera online news: "At least three people have been killed in an exchange of gunfire between  Liberia police and protesters as a mass opposition rally in Monrovia,  the capital, turned violent on the eve of a presidential election runoff  vote, according to reports from the scene.&lt;/p&gt;
&lt;p&gt;Opposition demonstratorsÃ‚Â took to the streetsÃ‚Â on MondayÃ‚Â after WinstonTubman, the opposition candidate hoping to unseat EllenJohnsonSirleaf,  said he would boycott the runoff and called on his supporters to do  likewise over fears of fraud favouring the incumbent president.&lt;/p&gt;
&lt;p&gt;Al Jazeera's Yvonne Ndege, in Monrovia, said that she was shown the  bodies of three men who had been killed by police during the protests.&lt;/p&gt;
&lt;p&gt;'The entire area where the opposition party HQ is situated has been  boarded up. Riot rounds have been fired, tear gas has been fired, ' she  said.&lt;/p&gt;
&lt;p&gt;"Opposition supporters took me into their HQ firsthand and showed me  three dead bodies of young men that they allege were shot  indiscriminately at by the Liberia police for simply protesting about  the decision to continue with tomorrow's presidential election.&lt;/p&gt;
&lt;p&gt;"It's an extremely bloody scene. It's so bloody, in fact, that the  United Nations has sent tanks down here and peacekeepers to try and stop  the confrontation between the Liberia police and those protesters."&lt;/p&gt;
&lt;p&gt;One police officer at the scene said aÃ‚Â supporter of the opposition  party, the Congress for Democratic Change (CDC), fired the first shot  prompting police to shoot back, after officers had earlier responded to  stone throwers with tear gas.&lt;/p&gt;
&lt;p&gt;However, an eye witness blamed the security forces for the flare-up and the deaths.&lt;/p&gt;
&lt;p&gt;"He was standing in front of the building when a policeman shot and I saw him going down," said witness Anita Mulba.&lt;/p&gt;
&lt;p&gt;Rocks and debris were strewn throughout the area, while journalists  working for the Reuters news agency saw several people injured,  including two police officers. They said a vehicle of the United  Nations' peacekeeping force (UNMIL) had also been attacked.&lt;/p&gt;
&lt;p&gt;The AFP news agency reported that one woman was wounded when police struck her on the head with a baton.&lt;/p&gt;
&lt;p&gt;'If today is anything to go by, I have real fear about tomorrow's elections going on peacefully, ' our correspondent said.&lt;/p&gt;
&lt;p&gt;'The question is: Will there be adequate violence and chaos to  instill, one has to say, a sense of fear in the electoral body about  going ahead tomorrow?"&lt;/p&gt;

&lt;p class="arcticle_text"&gt;AFP News online: "Monrovia- Liberia's main opposition has called  for a mass protest on Monday, on the eve of a run-off election which  candidate WinstonTubman is boycotting over fears the process will be  flawed.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;Tubman, who set the country on  edge with his call for voters to stay away from Tuesday's run-off  presidential election, said he wants his supporters to stage a "peaceful  protest" on Monday.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;A vigil outside his Congress for  Democratic Change headquarters on Saturday and Sunday drew only a  handful of people, far from the tens of thousands which spilled into the  streets ahead of the first round polls on October 11.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;The boycott call raised tensions  in the last days of an election campaign which fizzled out on Sunday as  the CDC was absent and a last tour through the capital by President  EllenJohnsonSirleaf failed to draw the crowds.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;Addressing the populous Red Light  market district, the Nobel Peace Prize winner praised her country's  eight years of peace after a brutal 14-year conflict which left some 250  000 dead ended in 2003.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;'I know that nobody in this country, no matter what the talk or rhetoric, nobody really wants us to go back to war,' she said.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;Tubman  claims the first round, in which he placed second with 32.7 percent of  the vote, was flawed by irregularities, and he has refused to take part  in the run-off until he is satisfied the process will be transparent.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;Sirleaf got 43.9 percent in the  first round and has since won the support of key smaller parties such as  that of Prince Johnson, a notorious former warlord who was filmed  ordering the torture of military dictator Samuel Doe and who scored  nearly 12 percent.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;The election has been billed as a  chance for the country to cement its fragile democracy and the  international community has condemnedWinstonTubman's boycott call.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;'We are very concerned. It's a bad  signal ... political leaders must be prepared to win or lose,' the head  of the African Union observer mission, Speciosa Wadira Kazibwe, a  former Ugandan vice-president, told reporters.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;The United States on Saturday said  it was 'deeply disappointed" by the boycott call, callingWinstonTubman's  claims of fraud 'unsubstantiated".&lt;/p&gt;
&lt;p class="arcticle_text"&gt;West Africa's political bloc  ECOWAS said it "deeply regrets the retrogressive tone" ofWinstonTubmanÃ¢â‚¬â„¢s  statement and urged all involved "not to miss this historic opportunity  of consolidating democracy and peace in the country".&lt;/p&gt;
&lt;p class="arcticle_text"&gt;Unity Party supporter Lucy Moore said that just two days before the election, she was both happy and sad.&lt;/p&gt;
&lt;p class="arcticle_text"&gt;"Happy because I know we are going to win no matter what. Sad because we are going alone to the polls."&lt;/p&gt;
&lt;p class="arcticle_text"&gt;Ciafa G Clarke, 29, an economics  student andWinstonTubman supporter told AFP that if the vote went ahead, "the  vast majority of the people will not recognise the regime".&lt;/p&gt;
&lt;p class="arcticle_text"&gt;UN leader Ban Ki-moon has urged  the rival sides to maintain calm and "not to resort to violence despite  political disagreement and to ensure that the peace in Liberia is  maintained".&lt;/p&gt;
&lt;p class="arcticle_text"&gt;Liberia, Africa's oldest  independent state, was founded by freed American slaves in 1847 and is  still scarred by the 14-year civil war which shattered infrastructure  and the economy.&lt;/p&gt;
&lt;p&gt;Sirleaf, who is hailed abroad for  her role in rebuilding the nation, has said she wants a second term to  rebuild the 'broken country' which is still heavily reliant on an 8  000-strong UN peacekeeping mission."&lt;/p&gt;

&lt;p&gt;Source: (Truth FM Mid-Day News)&lt;/p&gt;
&lt;p&gt;According to Truth FM 96.1 Radio station, reports coming in to their station stated that Mr. Mulbah Morlu, chairman for mobilization of the Congress of Democratic Change (CDC) - has said that the party has reached a concensus that all elected partisans of the CDC in the November 11, 2011 general elections will not take seat in the coming government since infact they considered the government to be unconstitutional and illegitimate.&lt;/p&gt;
&lt;p&gt;However, minutes after Mr. Morlu made this pronouncement, the Party Secretary General Mr. Acarous Gray called in to the station and said that Mr. Morlu was representing himself when he made the statement and that it is not the position of the Congress for Democratic Change (CDC). He further said if the party should have any agreement of that kind, it will be publicly announce by the party heirarchy.&lt;/p&gt;

&lt;p&gt;Source: Kings FM 88.5&lt;/p&gt;
&lt;p&gt;Ã‚Â &lt;/p&gt;
&lt;p&gt;Reports gathered from the Kings Fm radio station says Ã‚Â there is a riot where police are beating cdc partisans and shooting tears gas at the headquarters of the Congress for Democratic Change (CDC) in Ã‚Â Congo Town.&lt;/p&gt;

