&lt;p style="line-height: 0.16in; widows: 2; orphans: 2;"&gt;&lt;span style="color: #000000;"&gt;Ã¢â‚¬Å“&lt;span style="font-family: georgia, 'times new roman', times, serif;"&gt;&lt;span style="font-size: xx-small;"&gt;&lt;span style="font-style: normal;"&gt;&lt;span&gt;Mother EllenJohnsonSirleaf, sheÃ¢â‚¬â„¢s responsible,Ã¢â‚¬Â said George Weah, a former international soccer star who is the oppositionÃ¢â‚¬â„¢s vice-presidential candidate. Ã¢â‚¬Å“For shooting innocent Liberia, itÃ¢â‚¬â„¢s wrong.Ã¢â‚¬Â&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p style="font-style: normal; line-height: 0.16in; widows: 2; orphans: 2;"&gt;&lt;span style="color: #000000;"&gt;&lt;span style="font-family: georgia, 'times new roman', times, serif;"&gt;&lt;span style="font-size: xx-small;"&gt;The opposition headquarters were crammed with frenzied supporters after the clashes, and the body of a young man shot through the head was laid out in an upstairs room with other wounded.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p style="font-style: normal; line-height: 0.16in; widows: 2; orphans: 2;"&gt;&lt;span style="color: #000000;"&gt;&lt;span style="font-family: georgia, 'times new roman', times, serif;"&gt;&lt;span style="font-size: xx-small;"&gt;LiberiaÃ¢â‚¬â„¢s justice minister, Christiana Tah, said the elections would go ahead on Tuesday as scheduled. She confirmed that one person was dead and three were injured. But at the cityÃ¢â‚¬â„¢s Catholic Hospital, there were at least seven people injured from the clashes, five with gunshot wounds.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p style="line-height: 0.16in; widows: 2; orphans: 2;"&gt;&lt;span style="color: #000000;"&gt;Ã¢â‚¬Å“&lt;span style="font-family: georgia, 'times new roman', times, serif;"&gt;&lt;span style="font-size: xx-small;"&gt;&lt;span style="font-style: normal;"&gt;&lt;span&gt;We were dancing in the road; they started beating us,Ã¢â‚¬Â said Solomon Gardea, 30, an unemployed opposition supporter who said a bullet skinned the back of his head as he turned to run away. Ã¢â‚¬Å“We were just marching for peace.Ã¢â‚¬Â&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
